import React, { PureComponent } from 'react'
import {Link} from 'react-router-dom'
import Logo from '../logo.svg'

class Navbar extends PureComponent {
    
    render() {
        return (
            
            
 
                            <img src={Logo} alt="Home" className="navbar-brand"> </img>
                    
           
            
        )
    }
}

export default Navbar
